// import logo from "./logo.svg";
import { useState, useEffect } from "react";
import "./App.css";
import KeyButton from "./components/KeyButton";
import "./tailwind.css";

function App() {
  useEffect(() => {
    document.addEventListener("keydown", (e) => {
      const key = e.code.toUpperCase();
      console.log(key);
      document.getElementById(key).style.backgroundColor = "red";
    });
    return () => {
      document.removeEventListener("keydown", (e) => {
        // console.log(e.key);
      });
    };
  }, []);

  return (
    <>
      <div className="KeyContainer">
        {/* {First Row} */}
        <KeyButton keyName="Esc" CustomClass={" "} keyCode={"ESCAPE"} />

        <KeyButton
          keyName="F1"
          CustomClass={"ButtonPressed"}
          CustomStyle={{ gridColumn: "3" }}
          keyCode={"F2"}
        />
        <KeyButton keyName="F2" CustomClass={" "} keyCode={"F2"} />
        <KeyButton keyName="F3" CustomClass={" "} keyCode={"F3"} />
        <KeyButton keyName="F4" CustomClass={" "} keyCode={"F4"} />
        <KeyButton keyName="F5" CustomClass={" "} keyCode={"F5"} />
        <KeyButton keyName="F6" CustomClass={" "} keyCode={"F6"} />
        <KeyButton keyName="F7" CustomClass={" "} keyCode={"F7"} />
        <KeyButton keyName="F8" CustomClass={" "} keyCode={"F8"} />
        <KeyButton keyName="F9" CustomClass={" "} keyCode={"F9"} />
        <KeyButton keyName="F10" CustomClass={" "} keyCode={"F10"} />
        <KeyButton keyName="F11" CustomClass={" "} keyCode={"F11"} />
        <KeyButton keyName="F12" CustomClass={" "} keyCode={"F12"} />
        <KeyButton keyName="Del" CustomClass={" "} keyCode={"DELETE"} />
        <KeyButton keyName="Pause Break" CustomClass={" "} keyCode={"PAUSE"} />
        <KeyButton keyName="SCR" CustomClass={" "} keyCode={"PAUSE"} />
        <KeyButton keyName="Home End" CustomClass={" "} keyCode={"HOME"} />

        {/* {Second Row} */}
        <KeyButton keyName="~ `" keyCode={"BACKQUOTE"} />
        <KeyButton keyName="! 1" keyCode={"DIGIT1"} />
        <KeyButton keyName="@ 2" keyCode={"DIGIT2"} />
        <KeyButton keyName="# 3" keyCode={"DIGIT3"} />
        <KeyButton keyName="$ 4" keyCode={"DIGIT4"} />
        <KeyButton keyName="% 5" keyCode={"DIGIT5"} />
        <KeyButton keyName="^ 6" keyCode={"DIGIT6"} />
        <KeyButton keyName="& 7" keyCode={"DIGIT7"} />
        <KeyButton keyName="* 8" keyCode={"DIGIT8"} />
        <KeyButton keyName="( 9" keyCode={"DIGIT9"} />
        <KeyButton keyName=") 0" keyCode={"DIGIT0"} />
        <KeyButton keyName="- _" keyCode={"MINUS"} />
        <KeyButton keyName="+ =" keyCode={"EQUAL"} />
        <KeyButton keyName="← Backs" keyCode={"BACKSPACE"} />
        <KeyButton keyName="NumLK" keyCode={"NUMLOCK"} />
        <KeyButton keyName="/" keyCode={"NUMPADDIVIDE"} />
        <KeyButton keyName="*" keyCode={"NUMPADMULTIPLY"} />
        <KeyButton keyName="-" keyCode={"NUMPADSUBTRACT"} />

        {/* {Third Row} */}
        <KeyButton keyName="TAB ⇆" keyCode={"TAB"} />
        <KeyButton keyName="Q" keyCode={"KEYQ"} />
        <KeyButton keyName="W" keyCode={"KEYW"} />
        <KeyButton keyName="E" keyCode={"KEYE"} />
        <KeyButton keyName="R" keyCode={"KEY"} />
        <KeyButton keyName="T" keyCode={"KEY"} />
        <KeyButton keyName="Y" keyCode={"KEY"} />
        <KeyButton keyName="U" keyCode={"KEY"} />
        <KeyButton keyName="I" keyCode={"KEY"} />
        <KeyButton keyName="O" keyCode={"KEY"} />
        <KeyButton keyName="P" keyCode={"KEY"} />
        <KeyButton keyName="{ [" CustomClass={" "} />
        <KeyButton keyName="} ]" CustomClass={" "} />
        <KeyButton keyName="|  \" CustomClass={" "} />
        <KeyButton keyName="7" CustomClass={" "} />
        <KeyButton keyName="8" CustomClass={" "} />
        <KeyButton keyName="9" CustomClass={" "} />
        <KeyButton
          keyName="+"
          CustomStyle={{ gridRow: "span 2", height: "auto" }}
        />

        {/* {Third Row} */}
        <KeyButton keyName="CAPS LOCKS" CustomClass={" "} />
        <KeyButton keyName="A" CustomClass={" "} />
        <KeyButton keyName="S" CustomClass={" "} />
        <KeyButton keyName="D" CustomClass={" "} />
        <KeyButton keyName="F" CustomClass={" "} />
        <KeyButton keyName="G" CustomClass={" "} />
        <KeyButton keyName="H" CustomClass={" "} />
        <KeyButton keyName="J" CustomClass={" "} />
        <KeyButton keyName="K" CustomClass={" "} />
        <KeyButton keyName="L" CustomClass={" "} />
        <KeyButton keyName=": ;" CustomClass={" "} />
        <KeyButton keyName='" ' CustomClass={" "} />
        <KeyButton keyName="↲ ENTER" CustomClass={"col-span-2 "} />
        <KeyButton keyName="4" CustomClass={" "} />
        <KeyButton keyName="5" CustomClass={" "} />
        <KeyButton keyName="6" CustomClass={" "} />

        {/* {Fourth Row} */}
        <KeyButton keyName="Shift 🡁" CustomStyle={{ gridColumn: "span 2" }} />
        <KeyButton keyName="Z" CustomClass={" "} />
        <KeyButton keyName="X" CustomClass={" "} />
        <KeyButton keyName="C" CustomClass={" "} />
        <KeyButton keyName="V" CustomClass={" "} />
        <KeyButton keyName="B" CustomClass={" "} />
        <KeyButton keyName="N" CustomClass={" "} />
        <KeyButton keyName="M" CustomClass={" "} />
        <KeyButton keyName="< ," CustomClass={" "} />
        <KeyButton keyName="> ." CustomClass={" "} />
        <KeyButton keyName="? /" CustomClass={" "} />
        <KeyButton keyName="Shift 🡁" CustomStyle={{ gridColumn: "span 2" }} />
        <KeyButton keyName="1" CustomClass={" "} />
        <KeyButton keyName="2" CustomClass={" "} />
        <KeyButton keyName="3" CustomClass={" "} />
        <KeyButton
          keyName="Enter"
          CustomStyle={{ gridRow: "span 2", height: "auto" }}
        />

        {/* {Fifth Row} */}
        <KeyButton keyName="CTRL" keyCode={"CONTROLLEFT"} />
        <KeyButton keyName="FN" CustomClass={" "} />
        <KeyButton keyName="⊞ Win" CustomClass={" "} />
        <KeyButton keyName="ALT" CustomClass={" "} />
        <KeyButton keyName="&nbsp;" CustomClass={"col-span-6"} />
        <KeyButton keyName="ALT" CustomClass={" "} />
        <KeyButton keyName="FN" CustomClass={" "} />
        <KeyButton
          keyName="CTRL"
          CustomClass={"col-span-2"}
          keyCode={"CONTROLRIGHT"}
        />
        <KeyButton keyName="🡅" CustomClass={""} />
        <KeyButton keyName="0 INSERT" CustomClass={" "} />
        <KeyButton keyName=". DEL" CustomClass={" "} />

        {/* {Arraow in 7 row} */}
        <KeyButton
          keyName="🡄"
          CustomStyle={{ gridRow: "7", gridColumn: "14" }}
        />
        <KeyButton
          keyName="🡇"
          CustomStyle={{ gridRow: "7", gridColumn: "15" }}
        />
        <KeyButton
          keyName="🡆"
          CustomStyle={{ gridRow: "7", gridColumn: "16" }}
        />

        {/* {Mouse in 7 row} */}
        <KeyButton
          keyName="⮝"
          CustomStyle={{ gridRow: "7", gridColumn: "8 /span 2" }}
        />
        <KeyButton
          keyName="⮟"
          CustomStyle={{ gridRow: "7", gridColumn: "10/span 2" }}
        />
        <KeyButton
          keyName=""
          CustomStyle={{
            gridRow: "span 2",
            gridColumn: "8/span 4",
            height: "150px",
          }}
        />
      </div>
    </>
  );
}

export default App;
